import React from "react";
import { useEffect, useState } from "react";
import axios from "axios";
//import userlist from ./userlist

const Userlist = () => {

    const [Users, setUsers] = useState([]);

    React.useEffect(() => {
    //axios.get("http://localhost.5000/userlist").then((response) => {
    axios.get("http://127.0.0.1:5000/userlist").then((response) => {
        console.log(response.data);
        setUsers(response.data);
    });
    });
    /*
    return (
    <p>Nothing here</p>
    );*/
    /*return (
        <div>
        <pre>{JSON.stringify(Users, null, 2)}</pre>
        </div>
    );*/
    return(
        <div>
        <ul>
            {Users.map(item=> {
                return(
                    <li key={item.id}>
                    {item.username}{item.password}{item.email}{item.organization}{item.address}{item.city}{item.state}{item.country}{item.postalcode}
                    </li>
                );
            })}
        </ul>
        </div>
    );
};

const App = () => {
    return(
        <div>
        <Userlist/>
        </div>
    );
};

export default App;
